import React from 'react';
import { MDBCard, MDBCardBody, MDBRow, MDBCol, MDBContainer } from 'mdbreact';
import {Link} from 'react-router-dom';
import "./wallet.css";
import SideNavigation from './sideNavigation';
import BreadcrumSection from './pages/sections/BreadcrumSection';
export default function Wallet() {
    return (
        <>
        <SideNavigation/>
        <BreadcrumSection/>
             <MDBContainer/>
       <MDBRow className="mb-4 walletStyle">
        <MDBCol md="8" className="mb-3">
          <MDBCard className="classic-admin-card">
            <MDBCardBody>
            </MDBCardBody>
          </MDBCard>
        </MDBCol>
        <MDBCol md="4" className="mb-3">
          <MDBCard className="classic-admin-card">
            <MDBCardBody>
            </MDBCardBody>
          </MDBCard>
        </MDBCol>
        </MDBRow>
        <MDBContainer/>
        </>
    )
}
